import React from 'react';

const Header = (props) => {
    const { user } = props;
    return (
        <div className="header bg-secondary text-white text-center">
            <h1>PIZZA BANDIT</h1>
            <span className="small">Delivery so cheap you'll think it's stealing.</span>
            {(props.user) ? <button onClick={props.logout} className="btn btn-primary">Logout</button> : <span>Hello {user.emal}</span>}
        </div>
    )
}

export default Header;
